import { useEffect, useState } from 'react';

function App() {
  const [mensaje, setMensaje] = useState('');

  useEffect(() => {
    fetch('http://localhost:5000')
      .then(res => res.text())
      .then(data => setMensaje(data));
  }, []);

  return (
    <div>
      <h1>Frontend React</h1>
      <p>Mensaje desde el backend: {mensaje}</p>
    </div>
  );
}

export default App;
